import React from "react";
import {
  withScriptjs,
  withGoogleMap,
  GoogleMap,
  Marker
} from "react-google-maps";

const MapContainer = withScriptjs(
  withGoogleMap(props => (
    <GoogleMap
      google={props.google}
      defaultZoom={15}
      style={{ width: "100%" }}
      defaultCenter={{ lat: props.lat, lng: props.lon }}
    >
      {props.isMarkerShown && (
        <Marker position={{ lat: props.lat, lng: props.lon }} />
      )}
    </GoogleMap>
  ))
);

export default MapContainer;
